import React from "react"

const PokemonList = (props) => {
    const pokemonList = () =>{
        props.pokemonData.map((pokemon) => {
            return (
                <React.Fragment>
                    <div>
                        <li>
                            <div>pokemon.name}</div>
                        </li>
                    </div>
                </React.Fragment>

            )
        })
    }
    return (
        <h3>Hello</h3>
    )
}
export default PokemonList
